import React from "react";
import Car from "./car";

interface CardsProps {
  IDs: number[];
  page: number;
}

function Cards(props: CardsProps) {
  return (
    <div className="cards">
      {props.IDs.length <= 5
        ? props.IDs.map((ID: number) => <Car id={ID} />)
        : props.IDs.map((ID: number) => <Car id={ID} />) / 5}
    </div>
  );
}

export default Cards;
